import React from 'react';
import CardList from './Cardlist';
import {robots} from './robo';
import SearchBox from './SearchBox';

const App=()=>{
    return(
        <div className="tc">
           <h1>RoboSearch</h1>  
           <SearchBox/>
           <CardList robots={robots}/>
        </div>


    )
}
export default App;
